import { Button, Card, CardMedia, Divider, List, ListItem, ListItemText } from "@mui/material";
import { fontWeight, style } from "@mui/system";

interface Props {
  game_image: string;
  publisher: string;
  developer: string;
  release_date: string;
  platform: string;
}

export const GameInfoBasics: React.FC<Props> = (game) => {
  return (
    <Card
      sx={{
        maxWidth: "20rem",
        marginTop: "5rem",
        backgroundColor: "rgba(0,0,0,0)",
        boxShadow: "0",
      }}
    >
      <CardMedia
        sx={{
          aspectRatio: "16/9",
          maxWidth: "100%",
          borderRadius: 1,
          marginBottom: "2rem",
        }}
        component="img"
        alt={game.developer}
        image={game.game_image}
      />
      {/* <Button variant="outlined" sx={{color: "white", fontWeight: "400"}} fullWidth>Add to Favorites</Button> */}
      <List sx={{color: "gray"}} aria-label="mailbox folders">
        <ListItem>
          <ListItemText primary="Inbox" />
        </ListItem>
        <Divider light/>
        <ListItem>
          <ListItemText primary="Drafts" />
        </ListItem>
        <Divider light />
        <ListItem>
          <ListItemText primary="Trash" />
        </ListItem>
        <Divider light />
        <ListItem>
          <ListItemText primary="Spam" />
        </ListItem>
      </List>
    </Card>
  );
};
